                    <div class=""container-desc"">
                        <p>GameStop is committed to conducting its business on the principles of integrity and sound business ethics. We are also committed to holding our manufacturers, vendors and suppliers to these same principles, which include taking measures to ensure that parties we do business with maintain basic labor and human rights standards for their workers.</p>
