                        <p>Members of our direct import and merchandising teams personally visit the factories where our exclusive-branded products are produced. In addition, we have in the past, and will continue to in the future, engage a third party to perform scheduled factory audits of our manufacturing vendors to ensure they are operating within the param");
            WriteLiteral(@"eters of our Code of Conduct. These audits will continue on a periodic basis for as long as we do business with each of these manufacturers.</p>
                        <p>In addition to the above, each contract manufacturer is required to independently maintain sufficient documentation of its compliance with our Code of Conduct. GameStop will quickly investigate any reports of human trafficking anywhere in its supply chain, and will take swift action against any supplier that is found to have acted improperly. While contract manufacturers are not required to certify that all materials incorporated into the products they produce comply with laws regarding slavery and human trafficking, both these suppliers and their subcontractors must adhere to the Code of Conduct and certify that all their operations are completely free of any form of child labor, prison labor, bonded labor, indentured labor or otherwise.</p>
                        <p>In addition, all GameStop merchandising employees who maintain relatio");
